import React from "react";
import Register from "./Register";

function Form(props) {
  return (
    <form className="form">
      <input type="text" placeholder="Username" />
      <input type="password" placeholder="Password" />
      {props.userIsRegistered === true ? <button type="submit">Login</button> : <Register/>}

    </form>
  );
}

export default Form;
